  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <h1>
         Mi primer proyecto en React
        </h1>

      </header>
      <PrimerComponente></PrimerComponente>
    </div>
  );
}

export default App;
